HIMBAUAN UNTUK WARGA PONDOKGEDE, BEKASI

Sahabat warga PondokGede, dalam situasi terkini, mari kita bersama-sama jaga keamanan dan ketertiban wilayah kita.

üìç Yang perlu kita lakukan: ‚û°Ô∏èTetap tenang dan lanjutkan aktivitas normal. ‚û°Ô∏èHindari berdemo atau arak-arakan di jalan raya. ‚û°Ô∏èJangan menyebarkan konten yang dapat menimbulkan kecemasan. ‚û°Ô∏èJaga kampung kita dengan bergotong royong dan waspada. ‚û°Ô∏èLaporkan situasi mencurigakan kepada Lurah dan Pengurus RT/RW setempat. ‚û°Ô∏èSelalu berkoordinasi dengan Forkopimcam Kecamatan PondokGede.

Mari kita utamakan kebersamaan, hindari provokasi, dan jaga lingkungan kita agar tetap aman dan nyaman.

